  input: TEXT,F3XA,,"This amended yearend 2004 report is being filed in response to
    the FEC letter dated March 9, 2005.  The letter noted 4 candidate contributions
    that were listed on the report as being delivered after the 2004 general election.  As
    discussed on the phone with Mr. William Wiquist of FEC, the report was incorrectly
    completed and showed the contributions in question as being designated for the
    2004 general elections.  The checks were actually intended for the next general
    election for these candidates.  The checks were delivered after the 2004 general
    election and were properly noted as for 'general election'.  No where did it reference
    2004 general election.  Mr. Wiquist indicated that the filing of this report would
    resolve this matter without any further correspondence."
